    ('01', '03', '030554000000', TO_DATE('09/11/2018 00:00:00', 'MM/DD/YYYY HH24:MI:SS'), '- - أسماك رنجة (كلوبيا هارنجس، كلوبيا بالاسي)،أسماك أنشوفة (من أنواع انجروليس)، أسماك سردين ( ساردينيا بيلكاردوس ساردينويس)،وساردينلا (من أنواع ساردينلا) رنجه صغيرة أو اسبرط (سبراتوس سبراتوس)، أسماك أسقمري "ماكريل" (سكومبر سكومبراس،سكومبر أوسترالأسيكوس، سكومبر جابونيكوس)، أسماك اسقمري هندي (راسترليجر)، أسماك سير(سكومبروموروس)،أسماك اسقمري صغير "أسماك سليمان" وأسماك التن (من أنواعتراكوروس)، أسماك اسقمري و أسماك كريفالس (كرانكس)، أسماك كوبيا (راكيسنترون كاندوم)،أسماك زبيدي "بومفرت فضي" (بامبوس)، أسماك صوري المحيط الهادي (كولولابيس سيرا)، أسماك سكاد( دكابتروس)، أسماك كبلين (مالوتوس فيلوسوس)،أسماك أبو سيف (اكسيفياس جلاديوس)، أسماك التونة الوثابة الشرقية (كاواكاوا) (يوثينوس افينيس)، أسماك اسقمري "بينيت "(من أنواع ساردا)، أسماك المارلين "أسماك أوقيانوسي ضخم"، أسماك السلفيش، أسماك الراموح (ستيوفوريداي)',
     '-- Herrings (Clupea harengus, Clupea pallasii), anchovies (Engraulis spp.), sardines (Sardina pilchardus, Sardinops spp.), sardinella (Sardinella spp.), brisling or sprats (Sprattus sprattus), mackerel (Scomber scombrus, Scomber australasicus, Scomber japonicus), Indian mackerels (Rastrelliger spp.), seerfishes (Scomberomorus spp.), jack and horse mackerel (Trachurus spp.), jacks, crevalles (Caranx spp.), cobia (Rachycentron canadum), silver pomfrets (Pampus spp.), Pacific saury (Cololabis saira), scads (Decapterus spp.), capelin (Mallotus villosus), swordfish (Xiphias gladius), Kawakawa (Euthynnus affinis), bonitos (Sarda spp.), marlins, sailfishes, spearfish (Istiophoridae)”.', 51383);
