Values
    ('01', '03', '030350000000', TO_DATE('07/29/2019 00:00:00', 'MM/DD/YYYY HH24:MI:SS'), '- أسماك رنجة (كلوبيا هارنجس، كلوبيا بالاسي)، أسماك أنشوفة (من أنواع انجروليس)، أسماك السردين (أنواع ساردينيا بيلكاردوس ساردينوبس)، وأسماك ساردينلا ( أنواع ساردينلا) وأسماك رنجه صغيرة أو اسماك اسبرط (سبراتوس سبراتوس)، أسماك أسقمري "ماكريل" (سكومبر سكومبراس، سكومبر أوسترالأسيكوس، سكومبر جابونيكوس)، أسماك أسقمري هندي ( أنواع راسترليجر)، أسماك سير ( أنواع سكومبروموروس)، أسماك أسقمري صغير (أسماك سليمان) وأسماك التن ( انواع تراكوروس)، أسماك ماكريل وأسماك كريفالس (انواع كرانكس)، أسماك كوبيا (راكيسنترون كاندوم)، أسماك زبيدي (بومفرت فضي) (انواع بامبوس)، أسماك صوري المحيط الهادي(انواع كولولابيس سيرا)، أسماك سكاد( انواع دكابتروس)، أسماك كبلين (مالوتوس فيلوسوس)، ( أسماك أبو سيف (اكسيفياس جلاديوس)، أسماك التونة الوثابة الشرقية (كاواكاوا) (يوثينوس افينيس)، أسماك بونيت (أنواع ساردا)، أسماك المرلين(سمك أوقيانوسي ضخم)، أسماك السلفيش، أسماك الراموح (ايستيوفوريداي)، باستثناء أحشاء الأسماك الصالحة للأكل الداخلة في البنود الفرعية 0302.91 لغاية 030299 :',
     '- Herrings (Clupea harengus, Clupea pallasii), anchovies (Engraulis spp.), sardines (Sardina pilchardus, Sardinops spp.), sardinella (Sardinella spp.), brisling or sprats (Sprattus sprattus), mackerel (Scomber scombrus, Scomber australasicus, Scomber japonicus), Indian mackerels (Rastrelliger spp.), seerfishes (Scomberomorus spp), jack and horse mackerel (Trachurus spp.), jacks, crevalles (Caranx spp.), cobia (Rachycentron canadum), silver pomfrets (Pampus spp.), Pacific saury (Cololabis saira), scads (Decapterus spp.), capelin (Mallotus villosus), swordfish (Xiphias gladius), Kawakawa (Euthynnus affinis), bonitos (Sarda spp.), marlins, sailfishes, spearfish (Istiophoridae), excluding edible fish offal of subheadings 0302.91 to 0302.99 :', 58224);
